package org.springframework.samples.petclinic.vet;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertTrue;

import java.util.List;
import java.util.Set;

import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;

class VetTests {

	private Vet instance;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("getSpecialtiesInternal returns non-empty set after adding specialties")
	void testGetSpecialtiesInternalHappyPath() {
		Specialty specialty1 = new Specialty();
		Specialty specialty2 = new Specialty();

		instance.addSpecialty(specialty1);
		instance.addSpecialty(specialty2);

		Set<Specialty> specialties = instance.getSpecialtiesInternal();

		assertEquals(2, specialties.size());
		assertTrue(specialties.contains(specialty1));
		assertTrue(specialties.contains(specialty2));
	}

	@Test
	@DisplayName("getSpecialtiesInternal returns empty set when no specialties added")
	void testGetSpecialtiesInternalEdgeCase() {
		Set<Specialty> specialties = instance.getSpecialtiesInternal();

		assertTrue(specialties.isEmpty());
	}

	@Test
	@DisplayName("getSpecialties returns sorted list after adding specialties")
	void testGetSpecialtiesHappyPath() {
		Specialty specialty1 = new Specialty();
		Specialty specialty2 = new Specialty();

		instance.addSpecialty(specialty1);
		instance.addSpecialty(specialty2);

		List<Specialty> specialties = instance.getSpecialties();

		assertEquals(2, specialties.size());
	}

	@Test
	@DisplayName("getSpecialties returns empty list when no specialties added")
	void testGetSpecialtiesEdgeCase() {
		List<Specialty> specialties = instance.getSpecialties();

		assertTrue(specialties.isEmpty());
	}

	@Test
	@DisplayName("getNrOfSpecialties returns correct count after adding specialties")
	void testGetNrOfSpecialtiesHappyPath() {
		Specialty specialty1 = new Specialty();
		Specialty specialty2 = new Specialty();

		instance.addSpecialty(specialty1);
		instance.addSpecialty(specialty2);

		int nrOfSpecialties = instance.getNrOfSpecialties();

		assertEquals(2, nrOfSpecialties);
	}

	@Test
	@DisplayName("getNrOfSpecialties returns zero when no specialties added")
	void testGetNrOfSpecialtiesEdgeCase() {
		int nrOfSpecialties = instance.getNrOfSpecialties();

		assertEquals(0, nrOfSpecialties);
	}

	@Test
	@DisplayName("addSpecialty successfully adds a specialty")
	void testAddSpecialtyHappyPath() {
		Specialty specialty = new Specialty();

		instance.addSpecialty(specialty);

		assertEquals(1, instance.getNrOfSpecialties());
		assertTrue(instance.getSpecialtiesInternal().contains(specialty));
	}

	@Test
	@DisplayName("addSpecialty handles adding multiple specialties without error")
	void testAddSpecialtyEdgeCase() {
		Specialty specialty1 = new Specialty();
		Specialty specialty2 = new Specialty();

		instance.addSpecialty(specialty1);
		instance.addSpecialty(specialty2);
		instance.addSpecialty(specialty2); // Duplicate

		assertEquals(2, instance.getNrOfSpecialties()); // Assuming set doesn't allow
														// duplicates
	}

}
